import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-dom';
import Dashboard from '../dashboard';

class App extends React.Component {
  render() {
    return(
      <BrowserRouter>
        <div className="App">
          <Switch></Switch>
            <Route path='/' component={Dashboard}> </Route>
        </div>
      </BrowserRouter>
    )
  }
}

export default App;
